      <Navbar></Navbar>
      <section>
        <div className="container">
          <div className={classes.box}>
            <div className={`row ${classes.p}`}>
              <div className={`row my-2 ${classes.u}`}>
                <div className="col-6">
                  <h3 className={classes.a}>MyAccount</h3>
