                  >
                    Log out
                  </button>
                </div>
                <hr className="hr"></hr>
              </div>
              <div className="row my-2">
                <div className="col-5 ">
                  <img
                    src={require("./images/Alphabets/a.png")}
                    width="70"
                    height="70"
                  />
                </div>
                <div className="col-6 ">
                  <h5 className={classes.a}>{fullname}</h5>
                  <h5 className={classes.low}>{emailid}</h5>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default MyAccount;
